<!DOCTYPE html>
<html lang="en">
<head>
    <meta charset="UTF-8">
    <meta name="viewport"
          content="width=device-width, user-scalable=no, initial-scale=1.0, maximum-scale=1.0, minimum-scale=1.0">
    <meta http-equiv="X-UA-Compatible" content="ie=edge">
    <title>IIB - Login</title>
    <style>
        .error {
            border-bottom: 2px solid red;
        }
        html,
        body {
            height: 100%;
        }

        body {
            display: flex;
            align-items: center;
            padding-top: 40px;
            padding-bottom: 40px;
            background-color: #f5f5f5;
        }

        .form-signin {
            max-width: 330px;
            padding: 15px;
        }

        .form-signin .form-floating:focus-within {
            z-index: 2;
        }

        .form-signin input[type="email"] {
            margin-bottom: -1px;
            border-bottom-right-radius: 0;
            border-bottom-left-radius: 0;
        }

        .form-signin input[type="password"] {
            margin-bottom: 10px;
            border-top-left-radius: 0;
            border-top-right-radius: 0;
        }
        .form_button:hover {
            transition: all .3s ease-in-out;
            transform: scale(1.05);
        }
        .form_button:active {
            transition: all .0001s ease-in-out;
            transform: scale(1.1);
        }
        .error {
            border-bottom: 2px solid red !important;
        }
    </style>
    <link href="https://cdn.jsdelivr.net/npm/bootstrap@5.3.0-alpha1/dist/css/bootstrap.min.css" rel="stylesheet" integrity="sha384-GLhlTQ8iRABdZLl6O3oVMWSktQOp6b7In1Zl3/Jr59b6EGGoI1aFkw7cmDA6j6gD" crossorigin="anonymous">
</head>
<body class="text-center" >
<main class="form-signin w-100 m-auto">
    <form>
        <img class="mb-4" src="https://drive.google.com/uc?export=view&id=1kej53D1RDSB196YKbRnHRm3V79n4suy7" alt="" width="72" height="57">
        <h1 class="h3 mb-3 fw-normal">Please sign in</h1>

        <div class="form-floating uname_container">
            <input type="text" class="form-control" id="uname" placeholder="Username">
            <label for="uname">Username</label>
        </div>
        <div class="form-floating upass_container">
            <input type="password" class="form-control" id="upass" placeholder="Password">
            <label for="upass">Password</label>
        </div>

        <div class="checkbox mb-3">
            <label>
                <input type="checkbox" id="remember_me"> Remember me
            </label>
        </div>
        <div class="checkbox mb-3">
            <label>
                <input type="checkbox" onclick="pass_show()" > Show password
            </label>
        </div>
    </form>
    <button type="button" class="w-100 btn btn-lg btn-primary form_button" onclick="Submit()" >Sign in <span id="spin" class="spinner-border spinner-border-sm d-none" role="status" aria-hidden="true"></span></button>
    <button type="button" class="btn btn-danger form_button" onclick="elockdown()" style="margin-top: 3px;" >Emergency Lockdown(CtrlAlt + A)</button>
    <br>
    <br>
    <i>Loading may take several time. If after wating 1 minutes, you couldn't login: you may want to report it to us.</i>
</main>
